Read the file. Uncompress it and convert to lines (string). Use the transformer function we created earlier, split, to split into words. const words = read( fromFileUrl(import.meta.resolve("./warandpeace.txt.gz")),
) .transform(gunzip) .transform(toLines) .transform(split); Now we need to get (1) a count of all words and (2) a count of unique words. We can use tee to create two copies of the stream - since we have to count twice. This gets around the limitation of being able to use an iterable only once and means we don't have to do extra work splitting the document into words two times. const [w1, w2] = words.tee(); We can count the words in the first copy directly. For the second copy, we use the distinct transformer before counting. const [count, unique] = await Promise.all([ w1.count(), w2.transform(distinct).count(),
]); console.log(`Total word count: ${count.toLocaleString()}`);
console.log(`Unique word count: ${unique.toLocaleString()}`); The results: Total word count: 563,977
Unique word count: 18,609 Clean, readable code. Understandable error handling. Fast. The only downside is that the processing is done in-process (we only have one thread to work with in JavaScript). If you are doing other things at the same time, this will slow them down.

