Don't worry about understanding everything in this example yet. This shows a little of what is possible using proc. Given the text for War and Peace : Read the file into an AsyncIterable of Uint8Array. Uncompress it (the file is GZ'd). Convert to lowercase using JavaScript, because the JavaScript conversion is more correct than the one in tr. grep out all the words on word boundaries. tee this into two streams (AsyncIterable of Uint8Array) of words. Count the total number of words. Use sort with uniq to count the unique words. const [words1, words2] = read( fromFileUrl(import.meta.resolve("./warandpeace.txt.gz")),
) .transform(gunzip) .lines .map((line) => line.toLocaleLowerCase()) .run({ buffer: true }, "grep", "-oE", "(\\w|')+") .tee(); const [uniqueWords, totalWords] = await Promise.all([ words1.run("sort").run("uniq").lines.count(), words2.lines.count(),
]); console.log(`Total: ${totalWords.toLocaleString()}`);
console.log(`Unique: ${uniqueWords.toLocaleString()}`); Up to the point where we run Promise.all, this is asynchronous, streaming, lazily evaluated code. It is trivially running three child processes (grep, sort, and uniq), a DecompressionStream transform, and in-process logic to normalize to lower-case. This is all happening concurrently, mostly in parallel, one buffer, one line, or one word at a time.

