You can capture stderr by defining fnStderr in the process options. This example adds a timestamp and colors the stderr text red. const decoratedStderr: ProcessOptions<void> = { fnStderr: async (stderr) => { for await (const line of stderr.lines) { console.error(`${gray(new Date().toISOString())} ${red(line)}`); } },
}; await run( { ...decoratedStderr }, "bash", "-c", ` echo "This goes to stderr." >&2 echo "This goes to stdout." `,
).toStdout();
